css:
atom-text-editor,
:host {
  background-color: #000000;
  color: #ffffff;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #282a2e;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #373b41;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #373b41;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #282a2e;
  color: #c5c8c6;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #373b41;
  color: #c5c8c6;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #c5c8c6;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #969896;
}
atom-text-editor .invisible,
:host .invisible {
  color: #ffffff;
}
atom-text-editor .cursor,
:host .cursor {
  color: #ffffff;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #585858;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #969896;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.comment {
  color: #00ffff;
}
.entity.name.type {
  color: #f0c674;
}
.entity.other.inherited-class {
  color: #b5bd68;
}
.keyword {
  color: #d7875f;
}
.keyword.operator {
  color: #ffffff;
}
.keyword.control {
  color: #ffff00;
}
.keyword.import,
.keyword.include {
  color: #d7875f;
}
.keyword.other.special-method {
  color: #81a2be;
}
.keyword.other.unit {
  color: #de935f;
}
.storage.type {
  color: #87ffaf;
}
.storage.class {
  color: #ffff00;
}
.storage.function {
  color: #ffff00;
}
.constant {
  color: #af875f;
  font-weight: bold;
}
.constant.character.escape {
  color: #ffffff;
}
.constant.numeric {
  color: #d7875f;
  font-weight: normal;
}
.constant.other.color {
  color: #ff00ff;
}
.constant.other.symbol {
  color: #b5bd68;
}
.constant.language {
  color: #ff00ff;
  font-weight: normal;
}
.variable {
  color: #5f8787;
}
.variable.interpolation {
  color: #bf4040;
}
.variable.parameter.function {
  color: #ffffff;
}
.invalid.illegal {
  background-color: #cc6666;
  color: #000000;
}
.string {
  color: #afaf5f;
}
.string.regexp {
  color: #8abeb7;
}
.string.regexp .source.ruby.embedded {
  color: #de935f;
}
.string.other.link {
  color: #cc6666;
}
.punctuation.definition.string,
.punctuation.definition.variable {
  color: #afaf5f;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #81a2be;
}
.punctuation.definition.bold {
  color: #f0c674;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #b294bb;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #bf4040;
}
.support.class {
  color: #f0c674;
}
.support.function {
  color: #8abeb7;
}
.support.function.any-method {
  color: #81a2be;
}
.support.type {
  color: #d7d7af;
}
.todo {
  color: #ffff87;
  background: #875f00;
  font-weight: bold;
}
.entity.name.class,
.entity.name.type.class {
  color: #f0c674;
}
.entity.name.section {
  color: #81a2be;
}
.entity.name.tag {
  color: #cc6666;
  text-decoration: underline;
}
.entity.other.attribute-name {
  color: #de935f;
}
.entity.other.attribute-name.id {
  color: #81a2be;
}
.meta.class {
  color: #f0c674;
}
.meta.link {
  color: #de935f;
}
.meta.require {
  color: #81a2be;
}
.meta.selector {
  color: #b294bb;
}
.meta.separator {
  background-color: #373b41;
  color: #ffffff;
}
.meta.preprocessor {
  color: #d7875f;
}
.none {
  color: #ffffff;
}
.markup.bold {
  color: #de935f;
  font-weight: bold;
}
.markup.changed {
  color: #b294bb;
}
.markup.deleted {
  color: #cc6666;
}
.markup.italic {
  color: #b294bb;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #81a2be;
}
.markup.inserted {
  color: #b5bd68;
}
.markup.list {
  color: #cc6666;
}
.markup.quote {
  color: #de935f;
}
.markup.raw.inline {
  color: #b5bd68;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #b5bd68;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
.source.cmake .meta.function-call.command {
  color: #00ffff;
}
.source.cmake .support.function {
  color: #ffff00;
}
.source.cmake .variable {
  color: #87ffaf;
}
.source.cpp .storage.modifier {
  color: #ffff00;
}
.source.cpp .meta.preprocessor {
  color: #d7875f;
}
.source.cpp .meta.preprocessor .define,
.source.cpp .meta.preprocessor.macro {
  color: #5fd7ff;
}
.source.cpp.string.single {
  color: #ff00ff;
}
.source.gfm .markup.underline.link {
  color: #d7875f;
}
.source.gfm .entity {
  color: #5fd7ff;
  text-decoration: underline;
}
.source.gfm .list {
  color: #bcbcbc;
}
.source.makefile .recipe {
  color: #d7875f;
}
.source.makefile .target {
  color: #d7af5f;
}
.source.makefile .variable.other,
.source.makefile .punctuation.variable {
  color: #00ffff;
  font-weight: bold;
}
.source.makefile .support.function {
  color: #ffff00;
}
.source.python .global {
  color: #ffff00;
}
.source.python .entity.function {
  color: #d7af5f;
  font-weight: bold;
}
.source.python .support.function {
  color: #d7af5f;
}
.source.python .support.type {
  color: #d7af5f;
}
.source.python .keyword.operator.logical {
  color: #d7d787;
}
.source.python .keyword.other {
  color: #ffff00;
}
.source.python .variable.language {
  color: #bcbcbc;
  font-weight: bold;
}
.source.scss .support.function.misc {
  color: #d7af5f;
}
.source.scss .pseudo-class {
  color: #5fd7ff;
}
.source.scss .tag {
  color: #ffff00;
  text-decoration: none;
}
